		const minContrast = 60;

		function filterPoints(_imgData) {

			for (let i = 0; i < _imgData.length; i += channels) {
				
				let r = _imgData[i + 0];

				if (diff > minContrast)

		function detectPositions(_imgData, _width) {
			let markers = [];
			let targetPxs = [];

			for (let i = 0; i < _imgData.length; i += channels) {
				let r = _imgData[i + 0];
				let g = _imgData[i + 1];
				let b = _imgData[i + 2];

				let diff = 2 * r - g - b;
				if (diff < minContrast) continue;

				let y = Math.floor(i / channels / _width);
				let x = i / channels - y * _width;
				targetPxs.push([x, y]);
			}

			for (let i = 0; i < targetPxs.length; i++)
			{
				let foundMarkers = [];
				for (let m = 0; m < markers.length; m++)
				{
					let connected = false;
					for (let s = 0; s < markers[m].length; s++)
					{
						let distanceSqrt = (markers[m][s][0] - targetPxs[i][0])**2 + (markers[m][s][1] - targetPxs[i][1])**2;
						if (distanceSqrt > maxDistance**2) continue;
						connected = true;
						break;
					}
					if (!connected) continue;
					foundMarkers.push(m);
				}

				if (foundMarkers.length === 0)
				{
					markers.push([targetPxs[i]]);
				} else {
					markers[foundMarkers[0]].push(targetPxs[i]);
					for (let m = foundMarkers.length - 1; m > 0; m--)
					{
						markers[foundMarkers[0]] = [...markers[foundMarkers[0]], ...markers[foundMarkers[m]]];
						markers.splice(foundMarkers[m], 1);
					}
				}
			}

			let validMarkers = markers.filter(m => m.length > minMass); // Mass requirement

			let out = validMarkers.map(r => [
				Math.round(r.map(i => i[0]).reduce((a, b) => a + b, 0) / r.length),
				Math.round(r.map(i => i[1]).reduce((a, b) => a + b, 0) / r.length)
			]);
			

			let centre = [
				Math.round(out.map(r => r[0]).reduce((a, b) => a + b, 0)) / out.length,
				Math.round(out.map(r => r[1]).reduce((a, b) => a + b, 0)) / out.length
			];

			// Sort algorithm -> Sort the markers from left to right, top to bottom;
			out.sort((a, b) => {
				let dA = add(a, scale(centre, -1));
				let dB = add(b, scale(centre, -1));
				return Math.atan2(dA[1], dA[0]) < Math.atan2(dB[1], dB[0]);
			}); // Sorts counterclockwise from bottom left
			if (out.length !== 4) return console.warn('Error, could not detect 4 points:', out);

			
			return out;
		}

			    const d2 = crossProduct(p2, p3, point);
			    const d3 = crossProduct(p3, p4, point);

			    const hasNegative = (d1 < 0) || (d2 < 0) || (d3 < 0) || (d4 < 0);
			    const hasPositive = (d1 > 0) || (d2 > 0) || (d3 > 0) || (d4 > 0);

		function len(a) {
			return Math.sqrt(dot(a, a));
		}


		function unit(a) {
			let leng = len(a);
			return [a[0] / leng, a[1] / leng];
		}

		function dot(a, b) {
			return a[0]*b[0] + a[1]*b[1];
		}
		function add(a, b) {
			return [a[0] + b[0], a[1] + b[1]];
		}



		function createMatrix(_w, _h, _value = 0) {
			let newMatrix = [];
			for (let y = 0; y < _h; y++)
			{
				newMatrix.push([]);
				for (let x = 0; x < _w; x++)
				{
					newMatrix[y][x] = _value;
				}
			}
			return newMatrix;
		}
		function transpose(_matrix) {
			let newMatrix = [];
			for (let x = 0; x < _matrix[0].length; x++)
			{
				newMatrix.push([]);
				for (let y = 0; y < _matrix.length; y++)
				{
					newMatrix[x][y] = _matrix[y][x];
				}
			}
			return newMatrix;
		}
		function matrixMultiply(_a, _b) {
			let newMatrix = createMatrix(_b[0].length, _a.length);

			for (let y = 0; y < newMatrix.length; y++)
			{
				for (let x = 0; x < newMatrix[0].length; x++)
				{
					let value = 0;
					for (let l = 0; l < _a[0].length; l++)
					{
						value += _a[y][l] * _b[l][x];
					}
					newMatrix[y][x] = value;
				}
			}

			return newMatrix;
		}

		// https://web.archive.org/web/20210406035905/http://blog.acipo.com/matrix-inversion-in-javascript/
		function invertMatrix(M){
		    // I use Guassian Elimination to calculate the inverse:
		    // (1) 'augment' the matrix (left) by the identity (on the right)
		    // (2) Turn the matrix on the left into the identity by elemetry row ops
		    // (3) The matrix on the right is the inverse (was the identity matrix)
		    // There are 3 elemtary row ops: (I combine b and c in my code)
		    // (a) Swap 2 rows
		    // (b) Multiply a row by a scalar
		    // (c) Add 2 rows
		    
		    //if the matrix isn't square: exit (error)
		    if(M.length !== M[0].length){return;}
		    
		    //create the identity matrix (I), and a copy (C) of the original
		    var i=0, ii=0, j=0, dim=M.length, e=0, t=0;
		    var I = [], C = [];
		    for(i=0; i<dim; i+=1){
		        // Create the row
		        I[I.length]=[];
		        C[C.length]=[];
		        for(j=0; j<dim; j+=1){
		            
		            //if we're on the diagonal, put a 1 (for identity)
		            if(i==j){ I[i][j] = 1; }
		            else{ I[i][j] = 0; }
		            
		            // Also, make the copy of the original
		            C[i][j] = M[i][j];
		        }
		    }
		    
		    // Perform elementary row operations
		    for(i=0; i<dim; i+=1){
		        // get the element e on the diagonal
		        e = C[i][i];
		        
		        // if we have a 0 on the diagonal (we'll need to swap with a lower row)
		        if(e==0){
		            //look through every row below the i'th row
		            for(ii=i+1; ii<dim; ii+=1){
		                //if the ii'th row has a non-0 in the i'th col
		                if(C[ii][i] != 0){
		                    //it would make the diagonal have a non-0 so swap it
		                    for(j=0; j<dim; j++){
		                        e = C[i][j];       //temp store i'th row
		                        C[i][j] = C[ii][j];//replace i'th row by ii'th
		                        C[ii][j] = e;      //repace ii'th by temp
		                        e = I[i][j];       //temp store i'th row
		                        I[i][j] = I[ii][j];//replace i'th row by ii'th
		                        I[ii][j] = e;      //repace ii'th by temp
		                    }
		                    //don't bother checking other rows since we've swapped
		                    break;
		                }
		            }
		            //get the new diagonal
		            e = C[i][i];
		            //if it's still 0, not invertable (error)
		            if(e==0){return}
		        }
		        
		        // Scale this row down by e (so we have a 1 on the diagonal)
		        for(j=0; j<dim; j++){
		            C[i][j] = C[i][j]/e; //apply to original matrix
		            I[i][j] = I[i][j]/e; //apply to identity
		        }
		        
		        // Subtract this row (scaled appropriately for each row) from ALL of
		        // the other rows so that there will be 0's in this column in the
		        // rows above and below this one
		        for(ii=0; ii<dim; ii++){
		            // Only apply to other rows (we want a 1 on the diagonal)
		            if(ii==i){continue;}
		            
		            // We want to change this element to 0
		            e = C[ii][i];
		            
		            // Subtract (the row above(or below) scaled by e) from (the
		            // current row) but start at the i'th column and assume all the
		            // stuff left of diagonal is 0 (which it should be if we made this
		            // algorithm correctly)
		            for(j=0; j<dim; j++){
		                C[ii][j] -= e*C[i][j]; //apply to original matrix
		                I[ii][j] -= e*I[i][j]; //apply to identity
		            }
		        }
		    }
		    
		    //we've done all operations, C should be the identity
		    //matrix I should be the inverse:
		    return I;
		}

		function generateMapFunction(worldPoints, cameraPoints) {
			// x = image plane
			// X = world plane

			let B = [];
			for (let p = 0; p < worldPoints.length; p++) 
			{
				B.push([cameraPoints[p][0], cameraPoints[p][1], 1, 0, 0, 0, -worldPoints[p][0] * cameraPoints[p][0], -worldPoints[p][0] * cameraPoints[p][1]]);
				B.push([0, 0, 0, cameraPoints[p][0], cameraPoints[p][1], 1, -worldPoints[p][1] * cameraPoints[p][0], -worldPoints[p][1] * cameraPoints[p][1]]);
			}


			let D = [];
			for (let p = 0; p < worldPoints.length; p++) 
			{
				D.push([worldPoints[p][0]], [worldPoints[p][1]]);
			}


			// l = inv(B' * B) * B' * D;
			B_ = transpose(B);
			let inv = invertMatrix(matrixMultiply(B_, B));
			l = matrixMultiply(matrixMultiply(inv, B_), D);
			let C = [[l[6], l[7], 1]];
			let A = [
				[l[0][0], l[1][0], l[2][0]],
				[l[3][0], l[4][0], l[5][0]],
				[0, 0, 1]
			];

			return function mapToSpace(_coord) {
				let translatedCoord = add(_coord, [0, 0]);
				let coord = [[translatedCoord[0]], [translatedCoord[1]], [1]];
				let out = matrixMultiply(A, matrixMultiply(coord, invertMatrix(matrixMultiply(C, coord))));
				return [out[0][0], out[1][0]];			
			}
		}
